import React from 'react';

function sum(a,b){
    return (a+b);
}
function sub(a,b){
    return (a-b);
}
function div(a,b){
    return (a/b);
}
function mul(a,b){
    return (a*b);
}
export default sum;
export {sub,div,mul}
